import styled from "styled-components";
import LogoImage from '../../assets/image/logo.png';

const Header = () => {

    return (
        <div>
            {/* <BtnLogo></BtnLogo> */}
            <button><img src={LogoImage} alt="logo"/></button>
        </div>
    );
}


const BtnLogo = styled.button`
    width: 175px;
    height: 79px;
`;

export default Header;
